import React from 'react';

const QuickPriceFilter = ({ onPriceRangeSelect }) => {
    const priceRanges = [
        { label: 'Under $100', min: 0, max: 100 },
        { label: '$100 - $500', min: 100, max: 500 },
        { label: '$500 - $1000', min: 500, max: 1000 },
        { label: 'Over $1000', min: 1000, max: null }
    ];

    return (
        <div className="card">
            <h3>Quick Price Filter</h3>
            <div style={{ display: 'flex', flexDirection: 'column', gap: '0.5rem' }}>
                {priceRanges.map((range, index) => (
                    <button
                        key={index}
                        onClick={() => onPriceRangeSelect(range)}
                        style={{ textAlign: 'left', padding: '0.5rem' }}
                    >
                        {range.label}
                    </button>
                ))}
            </div>
        </div>
    );
};

export default QuickPriceFilter;
